    { autor: 'Manolete', tema: 'experiencias', contenido: 'Ayer fui de cari単osonas' },
    { autor: 'Felipe', tema: 'puterios', contenido: 'Ayer fui de cari単osonas' }
];

function Posts() {

    const insertarPost = (post) => {
        const {tema, autor, contenido} = post
        post.push(post)
    }

    return (
        <div className='contenedor-posts'>
        {posts.map((x) => (
            <Post elemento={x}/>
        ))}
        </div>
    );
}

export default Posts;
